$.extend(DataTable.ext.oSort,{"string-pre":function(e){if("string"!=typeof e){if(null===e||void 0===e||!e.toString)return"";e=e.toString()}return e.toLowerCase()},"string-asc":function(e,t){return t>e?-1:e>t?1:0},"string-desc":function(e,t){return t>e?1:e>t?-1:0},"html-pre":function(e){return e.replace(/<.*?>/g,"").toLowerCase()},"date-pre":function(e){var t=Date.parse(e);return(isNaN(t)||""===t)&&(t=Date.parse("01/01/1970 00:00:00")),t},"numeric-pre":function(e){return"-"==e||""===e?-(1/0):1*e}});